var $bm_rt;
var X, F, L, T, Cursor, Cursor, Cursor;
X = text.sourceText;
F = Math.round($bm_mod($bm_mul(time, thisComp.layer('URL Control Panel').effect('Blinking Speed')('Slider')), 1));
L = X.length;
T = $bm_sub($bm_mul(time, thisComp.layer('URL Control Panel').effect('Speed')('Slider')), $bm_mul(thisComp.layer('URL Control Panel').effect('StartAt')('Slider'), thisComp.layer('URL Control Panel').effect('Speed')('Slider')));
$bm_rt = Cursor = ' ';
if (F == 1 | T > 0)
    $bm_rt = Cursor = ' ';
if (T >= L)
    $bm_rt = Cursor = ' ';
if (T > 0)
    $bm_rt = $bm_sum(X.substr(0, T), Cursor);
else
    $bm_rt = Cursor;
